  false,\n\t\"url\": null,\n\t\"notes\": \"This land cover data set was produced as
  part of a cooperative project between the U.S. Geological Survey (USGS) and the
  U.S. Environmental Protection Agency (USEPA) to produce a consistent, land cover
  data layer for the conterminous U.S. based on 30-meter Landsat thematic mapper (TM)
  data. National Land Cover Data (NLCD) was developed from TM data acquired by the
  Multi-resoultion Land Characterization (MRLC) Consortium. The MRLC Consortium is
  a partnership of federal agencies that produce or use land cover data. Partners
  include the USGS (National Mapping, Biological Resources, and Water Resources Divisions),
  USEPA, the U.S. Forest Service, and the National Oceanic and Atmospheric Administration.\",\n\t\"license_title\":
